    return (
        <div>
            <h2>Check Out</h2>
            {/* go through all database entries, if checkIn=true then display */}
            <DisplayPIDs />
        </div>
    );
}

function DisplayPIDs() {
    set = []

    axios.get('http://127.0.0.1:8000/api/checkins/')
    .then(res => set = res.data)

    console.log(set)

}

export default checkOut;
